import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import your custom Navbar styles here

const Navbar = () => {
  // Replace these with actual user data from your app's state or context
  const user = {
    username: 'john_doe',
    profilePicture: 'https://example.com/profile-pic.jpg',
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          Social Media App
        </Link>
        <div className="navbar-user">
          <img src={user.profilePicture} alt="User Profile" className="navbar-profile-pic" />
          <span className="navbar-username">{user.username}</span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
